import React from 'react';
import {Container, Row, Col, Navbar} from 'react-bootstrap'

function Home() {
  document.title="Home Page"
  return (
    <Container>
      <Row>
        <Col>
          <Navbar bg="dark" variant="dark">
            <Navbar.Brand>anshor.space</Navbar.Brand>
          </Navbar>
        </Col>
      </Row>
    </Container>
  );
}

export default Home;
